const SENTENCES = {
    'TITLES': {
        'MAIN_TITLE' : 'A SIMPLE GAME IN THE GALAXY...',
        'QUESTION_TITLE' : 'Questions mode',
        'IDENTITY_TITLE' : 'Identity mode'
    }
}

Object.freeze(SENTENCES);
export default SENTENCES;
